import Card from "react-bootstrap/Card";

export const CardComponent = ({ NumeroDepto, capacidad, tarifa, direccion, comuna}) => {
    return(
    <Card className="card-style mx-auto">
      <Card.Body className="card-body">
        <Card.Title>Departamento</Card.Title>
        <Card.Text>{NumeroDepto}</Card.Text>
        <Card.Text>{capacidad}</Card.Text>
        <Card.Text>{tarifa}</Card.Text>
        <Card.Text>{direccion}</Card.Text>
        <Card.Text>{comuna}</Card.Text>
        <Card.Link href="#" >Reservar</Card.Link>
      </Card.Body>
    </Card>
    );
};
